import React from 'react';

import classes from './paymentOptions.module.css';

function PaymentOptions(props){
    const amount = localStorage.getItem("billStore") ? JSON.parse(localStorage.getItem("billStore")).amount : 0;
    return(
        <div className={classes.paymentOps}>
            <div>Order Total &#8377; {amount}</div>
            PAYMENT OPTIONS
            <ul>
                <li>Cash On Delivery</li>
                <li>Pay Now</li>
            </ul>
        </div>
    );
}

export default PaymentOptions;
